import React from "react";
import "./Die.css";


class App extends React.Component {
  render() {
    return (
      <div className="Die">
        <h1>Die</h1>
        <i
          className={`fas fa-dice-${this.props.dieNumber} ${
            this.props.isRolling === true ? "shake animated" : ""
          }`}
          onAnimationEnd={() => console.log("hello world")}
        />
      </div>
    );
  }
}

export default Die;
